import React, { useState } from "react";
import { useNavigate, Link } from "react-router-dom";
import axios from "axios";
import Swal from "sweetalert2";

function Sdashboard() {
  const [s1, setS1] = useState("");
  const [s2, setS2] = useState("");
  const [s3, setS3] = useState("");
  const [s4, setS4] = useState("");
  const [s5, setS5] = useState("");
  const [s6, setS6] = useState("");
  const [s7, setS7] = useState("");
  const [s8, setS8] = useState("");
  const [s9, setS9] = useState("");
  const [image, setImage] = useState(null); // Store selected image

  const navigate = useNavigate();

  // Handle image selection
  const handleImageChange = (e) => {
    const file = e.target.files[0];
    if (file) {
      const reader = new FileReader();
      reader.onloadend = () => {
        setImage(reader.result); // Convert image to Base64
      };
      reader.readAsDataURL(file);
    }
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    axios
      .post("http://localhost:5000/api/students/signup", {
        s1,
        s2,
        s3,
        s4,
        s5,
        s6,
        s7,
        s8,
        s9,
        image, // Send Base64 image to backend if needed
      })
      .then((res) => {
        Swal.fire("Marks updated successfully!", "", "success");
        navigate("/");
      })
      .catch((err) => {
        alert("Failed");
      });
  };

  return (
    <div className="w-full relative mt-0 shadow-2xl rounded my-24 overflow-hidden">
      <div className="top h-64 w-full bg-blue-600 overflow-hidden relative">
        <img
          src="https://images.unsplash.com/photo-1503264116251-35a269479413?auto=format&fit=crop&w=1050&q=80"
          alt=""
          className="bg w-full h-full object-cover object-center absolute z-0"
        />
        <div className="flex flex-col justify-center items-center relative h-full bg-black bg-opacity-50 text-white">
          <label htmlFor="profilePic">
            <img
              src={image || "https://via.placeholder.com/150"} // Default or selected image
              className="h-24 w-24 object-cover rounded-full cursor-pointer"
              alt="Profile"
            />
          </label>
          <input
            type="file"
            id="profilePic"
            accept="image/*"
            className="hidden"
            onChange={handleImageChange}
          />
          <h1 className="text-2xl font-semibold">Student</h1>
          <h4 className="text-sm font-semibold">Joined Since '19</h4>
        </div>
      </div>

      <div className="grid grid-cols-12 bg-white">
        <div className="col-span-12 md:col-span-10">
          <div className="px-4 pt-4">
            <form onSubmit={handleSubmit} className="flex flex-col space-y-8">
              <h3 className="text-2xl font-semibold p-6">Basic Information</h3>
              <hr />

              <div className="flex flex-col md:flex-row md:space-x-4">
                <div className="form-item w-full">
                  <label className="text-xl">Maths</label>
                  <input
                    type="number"
                    name="s1"
                    required
                    onChange={(e) => setS1(e.target.value)}
                    className="w-full rounded shadow py-1 px-2"
                  />
                </div>
                <div className="form-item w-full">
                  <label className="text-xl">Science</label>
                  <input
                    type="number"
                    name="s2"
                    required
                    onChange={(e) => setS2(e.target.value)}
                    className="w-full rounded shadow py-1 px-2"
                  />
                </div>
              </div>

              <button className="bg-green-600 text-white font-semibold w-32 py-2 px-4 rounded-md shadow-md">
                Submit
              </button>
            </form>
          </div>
        </div>
      </div>
    </div>
  );
}

export default Sdashboard;
